import React from "react";

const car = [
  { id: 1, name: "choi", price: 4500, explanation: "test" },
  { id: 2, name: "itoa", price: 6400, explanation: "test2" },
];

const Component = ({ car }) => (
  <div>
    <b>[{car.id}]</b>
    <span>
      {car.name}
      {car.price}
      {car.explanation}
    </span>
  </div>
);

const ComponentName = () => {
  return (
    <div>
      <h2> Car List </h2>
      {car.map((std) => (
        <Component car={std} />
      ))}
    </div>
  );
};

export default ComponentName;
